package tesseract

import (
	"encoding/base64"
	"github.com/otiai10/gosseract"
	"os"
	"socketAPI/common"
	"strings"
)

var B string = ""

func GetWordOfPic(picBase64 string) (string, error) {
	pic, err := base64.StdEncoding.DecodeString(picBase64)
	if err != nil {
		return "", err
	}
	file := "./upload/" + common.RandStr(10) + ".png"

	err = os.WriteFile(file, pic, 0644)
	defer os.Remove(file)
	if err != nil {
		return "", err
	}

	client := gosseract.NewClient()
	client.SetLanguage("chi_sim", "eng")
	defer client.Close()
	client.SetImage(file)
	text, err := client.Text()
	if err != nil {
		return "", err
	}

	return strings.Join(strings.Fields(text), ""), nil
}
